import React from 'react';
import '../styles/Learn.css'; // Import the CSS file
// Example image path

const Learn = () => {
  return (
    <div className="learn-container">
      <h1 className="learn-title">Learn About Conservation</h1>
      <p className="learn-description">
        Explore comprehensive resources, guides, and practical steps to help protect endangered species and preserve biodiversity. Together, we can make a difference.
      </p>
      <div className="learn-content">
        <div className="learn-text">
          <h2>What You Can Do:</h2>
          <ul>
            <li>Support wildlife protection programs</li>
            <li>Reduce waste and recycle</li>
            <li>Educate others about conservation</li>
            <li>Contribute to conservation charities</li>
          </ul>
        </div>
        <div className="learn-image">
          <img src='/assets/backgorundimg1.jpeg' alt="Conservation" />
        </div>
      </div>
    </div>
  );
};



export default Learn;
